      <text id="74" justification="0" size="4" underlined="false">
        <text>Collection of sockets, for
PubSub writing only.
E.g. Another user&apos;s message
will be delivered to users on this
socket.
Each socket individually is
synchronized when writing, so
that multiple PubSub message
delivery workers don&apos;t try to
write at the same time.</text>
      </text>
      <color id="75">
        <red>255</red>
        <green>228</green>
        <blue>181</blue>
        <alpha>255</alpha>
      </color>

      <backgroundColor reference="72"/>
      <borderColor reference="73"/>
      <textColor reference="73"/>
      <text id="80" justification="0" size="4" underlined="false">
        <text>Client handlers containing
sockets that the server reads
client requests on or responds
to those requests with.
E.g. A user sends a message
to this socket, or requests the
friend list to this socket.</text>
      </text>
      <color reference="75"/>
    </NoteNode>
    <NoteNode id="81">

      <revision>1</revision>
      <backgroundColor reference="72"/>
      <borderColor reference="73"/>
      <textColor reference="73"/>
      <text id="85" justification="0" size="4" underlined="false">
        <text>Thread-safe object that can
be called from many client
handlers at once.
All interactions (get and set)
with database are called on
this interfacing object, which
communicates to the store
on a thread-safe message
queue.
A client requests database
operations here, and the
interface returns a Future.
The Future and request are
passed to the store, which
fulfills the Future.</text>
      </text>
      <color reference="75"/>
    </NoteNode>
    <NoteNode id="86">
      <children id="87"/>
      <location class="Point2D.Double" id="88" x="720.0" y="500.0"/>

      <revision>1</revision>
      <backgroundColor reference="72"/>
      <borderColor reference="73"/>
      <textColor reference="73"/>
      <text id="90" justification="0" size="4" underlined="false">
        <text>Single threaded object
which contains all the
(non-thread-safe) data
structures.
Infinite loop of popping
requests off the queue
and completing their
associated Futures.
If a value associated
with PubSub is set, a
job is submitted to the
PubSub worker pool
to be delivered.</text>
      </text>
      <color reference="75"/>
    </NoteNode>
